def probability_nucleo(Text, Profile):
    probability = 1
    for i,char in enumerate(Text): 
        for j, listofprof in sorted(Profile.items()): 
            if char == j:
                probability *= listofprof[i]
    return probability
    
def ProfileMostProbable(Text, k, Profile):
    maxi = -1
    ppattern = ''
    for i, letter in enumerate(Text):
        for i in range(len(Text)-k+1):
            pattern = Text[i:i+k]
            probability = probability_nucleo(pattern,Profile)
            if (probability > maxi):
                maxi = probability
                ppattern = pattern
        return ppattern
